 const fetchPost = ()=>{
     dispatch(loadPostStart());
 };




return(
    <>
    <div style = {{textAlign : 'center'}}>
<h1>Api call using Saga</h1>
<button onClick = {fetchPost}>Fetch Api</button>
<div>
{
        stateapi.map((ele, ind)=>{
            return(
                <div key = {ind}> 
            <h3>{ele.title} </h3>
            </div>
            );
        })
    }
    </div>
</div>

    </>
);
